import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap once
import 'aos/dist/aos.css'; // Animation on Scroll (if used)
import 'swiper/css'; // Swiper core styles (if used)
import './App.css'; // Custom styles should be imported last to override

import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import HomePage from './components/HomePage';
import LoginPage from './components/LoginPage';
import Signup from './components/Signup';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/dashboard/*" element={<Dashboard />} /> {/* Keep wildcard only if nested routes exist */}
      </Routes>
    </div>
  );
}

export default App;
